import React from "react";
import { FooterWrapper } from "./style";
import { TitleFooter } from "./Component/TitleFooter";
const Footer = props => {
    return (
        <FooterWrapper className="footer">
            <div className="container">
                <div></div>
            </div>
        </FooterWrapper>
    );
}
export default Footer;
